import About from './component/About';

function App() {
  return (
    <div>

      <Nav/>

     <Routes>
      <Route exact path="/" element={<Home/>}/>
      <Route path="/product" element={<Product/>}/>
      <Route path="/about" element={<About/>}/>
      <Route path="/buyproduct/:id" element={<Buy/>}/>
      </Routes>

    </div>
  );
}

export default App;
